-- Cleanup

drop table if exists reviews cascade;
drop table if exists sells cascade;
drop table if exists monitors cascade;
drop table if exists produce cascade;
drop table if exists customers cascade;
drop table if exists humans cascade;
drop table if exists outlets cascade;

-- DDL

create table outlets (
  oid int primary key,
  zip int not null
);

create table humans (
  hid int primary key,
  hname varchar not null,
  oid int not null references outlets(oid)
);

create table monitors (
  hid int primary key references humans(hid),
  mrating int null
);

create table customers (
  cid int primary key,
  cname varchar not null
);

create table produce (
  pid int primary key,
  pname varchar not null unique
);

-- Option 2 for aggregation
create table sells (
  sid int primary key,
  hid int not null references humans(hid),
  cid int not null references customers(cid),
  pid int not null references produce(pid),
  swhen date not null,
  sprice int not null,
  unique (hid, cid, pid)
);

create table reviews (
  sid int primary key references sells(sid),
  hid int not null references monitors(hid),
  rgrade int not null,
  rwhen date not null
);

-- data
